                    this.altro.push(  this.insert4BOM({name:'KIT STAFFA TELESCOPICA PEDANA',               n: 1,   gruppo:this.lista_nodi[i].etk, lunghezza:this.round(0), codifica: this.ricodificaNodo(this.lista_nodi[i].etk)}));
