costruisciStr(strIn){
  let str = '';
  if(['AB','BC','CD','AD'].includes(strIn.split('_')[0]))
  {
    switch(strIn.split('_')[0])
    {
      case 'AB':
          str += 'd';
      break;
      case 'BC':
          str += 'c';
      break;
      case 'CD':
          str += 'b';
      break;
      case 'AD':
          str += 'a';
      break;    
    }
    
    if(strIn.split('-').length==1)
    {
      switch(strIn.split('_')[1])
      {
          case 'A1':
              str += '1';
          break;
          case 'A2':
              str += '2';
          break;
          case 'S1':
              str += '3';
          break;
          case 'S2':
              str += '4';
          break;     
      }        
    }

    if(strIn.split('-').length>1)
    {
      switch(strIn.split('-')[0].split('_')[1])
      {
          case 'A1':
              str += '1';
          break;
          case 'A2':
              str += '2';
          break;
          case 'S1':
              str += '3';
          break;
          case 'S2':
              str += '4';
          break;     
      }
      str += strIn.split('-')[1];
    }
  }
  else
      str = strIn;

 return str;     
}


