          xTMP =this.DisegnaCollegamento230VAC_NEW(centralinaTVALL2, dimensioni, {power:240, etk: tmpstr, unionAllowed:true, pref:['D', 'A', 'C', 'B'], inverti_regola:false}, '', {dx:0, dy:1.51}, 0, 0);
