function EsportaListaCosti()
{
let lista = [];
for(let i=0;i<FISHER_COD.length;i++)
{
  let obj = {};
  obj.smeup       = FISHER_COD[i].code;
  obj.descrizione = FISHER_COD[i].descrizione.id;
  obj.peso        = FISHER_COD[i].peso;
  obj.costo       = FISHER_COD[i].costo;

  lista.push(obj);  
}
return lista;
}